import React from 'react';

class Results extends React.Component {
    render(){
        const round ={padding:'5px',background:'#73AD21',borderRadius:'25px'}

        return(
            <div className="list-group">
                {/* <a href="#" className="list-group-item list-group-item-action" >Your Results!!!</a> */}
                <li style={{fontWeight:'100px'}} class="list-group-item d-flex justify-content-between align-items-center" >Your Results !</li>
                <br></br>

                <a style={{color:'black'}} href="#" className="list-group-item list-group-item-action list-group-item-primary" style={round}>This is a primary list group item</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-secondary" style={round}>This is a secondary list group item</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-success" style={round}>This is a success list group item</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-danger" style={round}>This is a danger list group item</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-warning" style={round}>This is a warning list group item</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-info" style={round}>This is a info list group item</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-light" style={round}>This is a light list group item</a>
                <br></br>
                <a href="#" className="list-group-item list-group-item-action list-group-item-dark" style={round}>This is a dark list group item</a>
            </div>

            );

        }

    }

export default Results;
